class Solution:
    #Regular Expression Matching
    def isMatch(self,s,p):
        lens = len(s)
        lenp = len(p)
        dp = [[False for i in range(lenp+1)] for j in range(lens+1)]
        dp[0][0]=True
        for  i in range(1,lenp+1):
            if p[i-1]=='*':
                if i>=2:
                    dp[0][i] = dp[0][i-2]
        for i in range(1,lens+1):
            for j in range (1,lenp+1):
                if p[j-1]=='.':
                    dp[i][j]=dp[i-1][j-1]
                elif p[j-1]=='*':
                    #a a*||a ab*||abb ab*
                    dp[i][j] = dp[i][j-1] or dp[i][j-2] or (dp[i-1][j] and (s[i-1]==p[j-2] or p[j-2]=='.'))
                else:
                    dp[i][j] = dp[i-1][j-1] and s[i-1]==p[j-1]
        return dp[lens][lenp]
    #Palindrome Partitioning
    def partition(self, s):
        result = []
        cur = []
        lens = len(s)
        mp = self.allpalindrome(s)
        self.parchild(s,0,mp,cur,result)
        return result
    def allpalindrome(self,s):
        lens = len(s)
        mp = [[False for x in range(0,lens)] for y in range(0,lens)]
        for i in range(0,lens):
            for j in range(0,i+1):
                if s[j]==s[i] and (i-j<2 or mp[j+1][i-1]):
                    mp[j][i]=True
                else:
                    mp[j][i]=False
        return mp
    def parchild(self,s,start,mp,cur,result):
        lens = len(s)
        if start==lens:
            result.append(list(cur))
        for i in range(start,lens):
            if mp[start][i]:
                cur.append(s[start:i+1])
                self.parchild(s,i+1,mp,cur,result)
                cur.pop()
    #Palindrome Partition II---TLE Time Limit Exceeded
    def minCut(self, s):
        lens=len(s)
        if lens == 0:
            return 0
        mp = self.allpalindrome(s)
        minc = [0 for x in range(len(s))]

        for i in range(0,lens):
            min = lens
            if mp[0][i]:
                minc[i] = 1
            else:
                for j in range(0,i):
                    if mp[j+1][i] and minc[j]+1<min:
                        min = minc[j]+1
                minc[i]=min
        return minc[lens-1]
    #Valid Palindrome
    def isPalindrome(self, s):
        lens = len(s)
        s=s.upper()
        i = 0
        j =lens-1
        while i<j:
            if not s[i].isalnum():
                i=i+1
            elif not s[j].isalnum():
                j=j-1
            else:
                if s[i]==s[j]:
                    i=i+1
                    j=j-1
                else:
                    return False
        return True
    #Palindrome number
    def isPalindromeN(self, x):
        if x<0:
            return False
        div =1
        while x//div >=10:
            div*=10
        while x>0:
            if x//div!=x%10:
                return False
            else:
                x=x%div//10
                div=div//100
        return True
    #Longest Valid Parentheses
    def longestValidParentheses(self, s): 
        lens = len(s)
        if lens == 0:
            return 0
        stack = []
        left = -1
        maxlen = 0
        for i in range(0,lens):
            if s[i]=='(':
                stack.append(i)
            else:
                if len(stack) == 0:
                    left = i
                else:
                    stack.pop()
                    if len(stack) == 0:
                        maxlen = max([i-left,maxlen])
                    else:
                        maxlen = max([i-stack[-1],maxlen])
        return maxlen
    def longestValidParenthesesDP(self, s):
        lens = len(s)
        if lens == 0:
            return 0
        maxlen = 0
        d = [0 for x in range(lens)] 
        for i in reversed(range(lens-1)):
            if s[i]==')':
                d[i]=0
            else:
                j = (i+1)+d[i+1]
                if j<lens and s[j]==')':
                    d[i]=d[i+1]+2
                    if j+1 < lens:
                        d[i]=d[i]+d[j+1]
            maxlen = max([maxlen,d[i]])
        return maxlen
    #N Queens
    def totalNQueens(self, n):
        def check(k,j):
            for i in range(k):
                if board[i]==j or abs(k-i)==abs(board[i]-j):
                    return False
            return True
        board = [-1 for x in range(n)]
        row = 0
        col = 0
        sum = 0
        while row>=0:
            if check(row,col):
                board[row] = col
                if row == n-1:
                    sum+=1
                    col+=1
                    board[row]=-1
                else:
                    row+=1
                    col=0
            else:
                col=col+1
            while col ==n and row>=0:
                row=row-1
                col=board[row]+1
                board[row]=-1
        return sum
    def solveNQueens(self, n):
        def check(k,j):
            for i in range(k):
                if board[i]==j or abs(k-i)==abs(board[i]-j):
                    return False
            return True
        def buildRow(num,k):
            result = ''
            for i in range(num):
                if i == k:
                    result=result+'Q'
                else:
                    result=result+'.'
            return result
        out=[['.' for x in range(n)] for y in range(n)]
        board = [-1 for x in range(n)]
        row = 0
        col = 0
        sum = 0
        result = []

        while row>=0:
            if check(row,col):
                board[row] = col
                out[row] = buildRow(n,col)
                if row == n-1:
                    col+=1
                    result.append(list(out))
                    board[row]=-1
                    out[row]=buildRow(n,-1)
                else:
                    row+=1
                    col=0
            else:
                col=col+1
            while col ==n and row>=0:
                row=row-1
                col=board[row]+1
                board[row]=-1
                out[row]=buildRow(n,-1)
        return result
    #Sudoku
    def modifyMask(self,rmask,cmask,bmask,i,j,b,change):
        rmask[i]^=change
        cmask[j]^=change
        bmask[b]^=change
    def dfsSudoku(self,board,k,rmask,cmask,bmask):
        if k == 81:
            return True
        i,j = k/9,k%9
        b=i/3*3+j/3
        if board[i][j]!='.':
            return self.dfsSudoku(board,k+1,rmask,cmask,bmask)
        for digit in range(9):
            change = 1<<digit
            if rmask[i]&change==0 and cmask[j]&change==0 and bmask[b]&change==0:
                self.modifyMask(rmask,cmask,bmask,i,j,b,change)
                board[i][j]=str(digit+1)
                if self.dfsSudoku(board,k+1,rmask,cmask,bmask):
                    return True
                board[i][j]='.'
                self.modifyMask(rmask,cmask,bmask,i,j,b,change)
        return False  
    def solveSudoku(self, board):
        board = [[x for x in y] for y in board]
        rmask,cmask,bmask = [0]*9,[0]*9,[0]*9
        for i in range(9):
            for j in range(9):
                b = i/3*3+j/3
                if board[i][j]!='.':
                    change = 1<<(int(board[i][j])-1)
                    self.modifyMask(rmask,cmask,bmask,i,j,b,change)
        return self.dfsSudoku(board,0,rmask,cmask,bmask)
